import axios from 'axios'

export function getAllMeetList(){
    const apiUrl = 'http://127.0.0.1:8000/api/apiOverview';
    let request = axios.get(apiUrl)
    const dataPromise = request.then(response => {
        let data = response.data;
        return(data);
        }
    );   
    return(dataPromise); 
}
